import { Fragment, useState, useEffect } from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import { ClickAwayListener } from "@mui/material";
import Closets from "../../Components/Closets";
import Button from "../../Components/Button";
import NavBar from "../../Components/Navbar";
import styles from "./styles.module.scss";
import logo from "../../images/DWEAR_Logo.png";
import { AccountCircle, ArrowDropUp, ArrowDropDown, Checkroom, Person, Logout } from "@mui/icons-material";

const closets = [
    { _id: 1, img: "", desc: "Default Closet 1" },
    { _id: 2, img: "", desc: "Default Closet 2" },
];

const Home = () => {
    const [userData, setUserData] = useState(null);
    const [loading, setLoading] = useState(true);
    const location = useLocation();
    const navigate = useNavigate();
    const [menu, setMenu] = useState(false);

    const handleLogout = () => {
        navigate('/');
    };

    useEffect(() => {
        if (location.state && location.state.userData) {
            setUserData(location.state.userData);
            setLoading(false);
        } else {
            setLoading(false); // Ensure loading is false even if no userData is passed
        }
    }, [location.state]);

    if (loading) {
        return <p>Loading...</p>;
    }

    return (
        <Fragment>
            <div className={styles.container1}>
                <div className={styles.left}>
                    <div className={styles.logo}>
                        <Link to="/">
                            <img src={logo} alt="logo" />
                        </Link>
                    </div>
                </div>
                <div className={styles.right}>
                    {userData && (
                        <div className={styles.profile_menu} onClick={() => setMenu(!menu)}>
                            <AccountCircle />
                            <p>{userData.name}</p>
                            {menu ? <ArrowDropUp /> : <ArrowDropDown />}
                        </div>
                    )}
                </div>
                {menu && (
                    <ClickAwayListener onClickAway={() => setMenu(false)}>
                        <div className={styles.menu}>
                            <Link to="/home">
                                <div className={styles.options}>
                                    <p>Closets</p>
                                    <Checkroom />
                                </div>
                            </Link>
                            <Link to="/profile">
                                <div className={styles.options}>
                                    <p>Update Profile</p>
                                    <Person />
                                </div>
                            </Link>
                            <Link to="/">
                                <div className={styles.options} onClick={handleLogout}>
                                    <p>Logout</p>
                                    <Logout />
                                </div>
                            </Link>
                        </div>
                    </ClickAwayListener>
                )}
            </div>

            <div className={styles.container2}>
                <div className={styles.top}>
                    <h1>Your Closets</h1>
                    <Link to="/create_closet">
                        <Button label="Create New Closet" style={{ width: "20rem", marginRight: "5rem" }} />
                    </Link>
                </div>

                <div className={styles.closets_container}>
                    <Closets closets={closets} />
                </div>
            </div>
        </Fragment>
    );
};

export default Home;
